import React from 'react';
import style from './TripList.module.css';
import tripListData from './TripListData.js'

import Container from '@material-ui/core/Container';



export default function CenteredGrid() {
  return (
    <>  
      {tripListData.map(item => (
      <Container maxWidth="sm"> 

         <Container maxWidth="sm"> 
         <div>For {item.numberOfPeople}, during {item.tripLength}, in the {item.seasonTime}</div>
       </Container>
       </Container>
      ))}
    </>
  );
}

const containerWithCityName = () => {
  return (
    <Container maxWidth="sm"> 
      <div>{item.city} </div>
        </Container>
  )
}
